import React from 'react';
import './App.css';
import Auth from './Auth';
import Registration from './Registration';


function isLogged(logged: boolean){
  if(logged == true) return <Auth/>
}
function isRegistrated(registrated: boolean){
  if(registrated == true) return <Registration/>
}


function App() {
  return (
    <div className = 'btn-block'>
      <button className = 'btn' onClick = {()=>isLogged(true)}>Login</button>
      <button className = 'btn' onClick = {()=>{isRegistrated(true)}}>Sign up</button>
    </div>
  );
}

export default App;
